import{_ as e,o as r,c as o,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 19.2-386.33 Forfeiture of money, etc., derived from violation of §§ 2.2-3103 through 2.2-3112.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-386.33.md","filePath":"vacode/19.2-386.33.md"}'),a={name:"vacode/19.2-386.33.md"},i=t('<h1 id="§-19-2-386-33-forfeiture-of-money-etc-derived-from-violation-of-§§-2-2-3103-through-2-2-3112" tabindex="-1">§ 19.2-386.33 Forfeiture of money, etc., derived from violation of §§ 2.2-3103 through 2.2-3112. <a class="header-anchor" href="#§-19-2-386-33-forfeiture-of-money-etc-derived-from-violation-of-§§-2-2-3103-through-2-2-3112" aria-label="Permalink to &quot;§ 19.2-386.33 Forfeiture of money, etc., derived from violation of §§ 2.2-3103 through 2.2-3112.&quot;">​</a></h1><p>In addition to any other fine or penalty provided by law, any money or other thing of value derived by an officer or employee from a violation of §§ <a href="http://law.lis.virginia.gov/vacode/2.2-3103/" target="_blank" rel="noreferrer">2.2-3103</a> through <a href="http://law.lis.virginia.gov/vacode/2.2-3112/" target="_blank" rel="noreferrer">2.2-3112</a> shall be forfeited, in accordance with the procedures contained in Chapter 22.1 (§ <a href="http://law.lis.virginia.gov/vacode/19.2-386.1/" target="_blank" rel="noreferrer">19.2-386.1</a> et seq.). If the thing of value received by the officer or employee in violation of §§ <a href="http://law.lis.virginia.gov/vacode/2.2-3103/" target="_blank" rel="noreferrer">2.2-3103</a> through <a href="http://law.lis.virginia.gov/vacode/2.2-3112/" target="_blank" rel="noreferrer">2.2-3112</a> increases in value between the time of the violation and the time of discovery of the violation, the greater value shall determine the amount of forfeiture.</p><p>2012, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0283" target="_blank" rel="noreferrer">283</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0756" target="_blank" rel="noreferrer">756</a>.</p>',3),n=[i];function f(l,h,c,d,v,s){return r(),o("div",null,n)}const p=e(a,[["render",f]]);export{g as __pageData,p as default};
